import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Box,
  Card,
  CardContent,
  Typography,
  Button,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  TableContainer,
  Paper,
  Alert,
  CircularProgress,
  Chip,
  IconButton,
  MenuItem,
  Select,
  FormControl,
  InputLabel,
  TextField
} from "@mui/material";
import { UploadFile, Delete, Download } from "@mui/icons-material";

interface Document {
  id: number;
  title: string;
  filename: string;
  document_level: "LIVRE" | "RESTRITO" | "CONFIDENCIAL";
  uploaded_at: string;
}

interface User {
  email: string;
  access_level: "BASICO" | "INTERMEDIARIO" | "TOTAL";
}

const DocumentsManagement: React.FC = () => {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [documents, setDocuments] = useState<Document[]>([]);
  const [user, setUser] = useState<User | null>(null);

  // Upload
  const [file, setFile] = useState<File | null>(null);
  const [title, setTitle] = useState("");
  const [docLevel, setDocLevel] = useState<"LIVRE" | "RESTRITO" | "CONFIDENCIAL">("LIVRE");

  // Simular login
  useEffect(() => {
    // Aqui você faria login real, mas vamos simular:
    const loggedUser: User = {
      email: "thiago@email.com",
      access_level: "INTERMEDIARIO"
    };
    setUser(loggedUser);
  }, []);

  useEffect(() => {
    if (!user) return;

    fetchDocuments();
  }, [user]);

  const fetchDocuments = async () => {
    setLoading(true);
    setError(null);
    try {
      const res = await axios.get("http://localhost:8000/api/documents", {
        params: { user_email: user?.email },
      });
      setDocuments(res.data.documents.map((doc: any) => ({
        ...doc,
        uploaded_at: new Date(doc.uploaded_at).toLocaleDateString("pt-BR")
      })));
    } catch (err: any) {
      setError(err.response?.data?.detail || "Erro ao carregar documentos");
    } finally {
      setLoading(false);
    }
  };

  const handleUpload = async () => {
    if (!file || !title || !user) {
      setError("Preencha o título e selecione um arquivo");
      return;
    }

    const formData = new FormData();
    formData.append("title", title);
    formData.append("document_level", docLevel);
    formData.append("uploader_email", user.email);
    formData.append("file", file);

    try {
      await axios.post("http://localhost:8000/api/documents/upload", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      setTitle("");
      setFile(null);
      setDocLevel("LIVRE");
      fetchDocuments();
    } catch (err: any) {
      setError(err.response?.data?.detail || "Erro ao enviar documento");
    }
  };

  const handleDownload = (documentId: number, filename: string) => {
    if (!user) return;
    axios.get(`http://localhost:8000/api/documents/${documentId}/download`, {
      params: { user_email: user.email },
      responseType: "blob"
    }).then(res => {
      const url = window.URL.createObjectURL(new Blob([res.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", filename);
      document.body.appendChild(link);
      link.click();
      link.remove();
    }).catch(err => {
      setError(err.response?.data?.detail || "Erro ao baixar documento");
    });
  };

  const handleDelete = (docId: number) => {
    alert("Excluir documento ainda não implementado");
  };

  if (!user) {
    return <Typography>Faça login para acessar os documentos</Typography>;
  }

  return (
    <Card>
      <CardContent>
        <Box display="flex" justifyContent="space-between" alignItems="center" mb={2}>
          <Typography variant="h5">Gerenciamento de Documentos</Typography>
        </Box>

        {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

        {/* Formulário de Upload */}
        <Box display="flex" gap={2} mb={3}>
          <TextField
            label="Título"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
          <input
            type="file"
            onChange={(e) => setFile(e.target.files ? e.target.files[0] : null)}
          />
          <FormControl sx={{ minWidth: 150 }}>
            <InputLabel>Nível de Acesso</InputLabel>
            <Select
              value={docLevel}
              label="Nível de Acesso"
              onChange={(e) => setDocLevel(e.target.value as any)}
            >
              {user.access_level === "BASICO" && <MenuItem value="LIVRE">LIVRE</MenuItem>}
              {user.access_level === "INTERMEDIARIO" && <>
                <MenuItem value="LIVRE">LIVRE</MenuItem>
                <MenuItem value="RESTRITO">RESTRITO</MenuItem>
              </>}
              {user.access_level === "TOTAL" && <>
                <MenuItem value="LIVRE">LIVRE</MenuItem>
                <MenuItem value="RESTRITO">RESTRITO</MenuItem>
                <MenuItem value="CONFIDENCIAL">CONFIDENCIAL</MenuItem>
              </>}
            </Select>
          </FormControl>
          <Button variant="contained" startIcon={<UploadFile />} onClick={handleUpload}>
            Enviar
          </Button>
        </Box>

        {loading ? (
          <Box display="flex" justifyContent="center" alignItems="center" minHeight="150px">
            <CircularProgress />
          </Box>
        ) : (
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Título</TableCell>
                  <TableCell>Nível</TableCell>
                  <TableCell>Data Upload</TableCell>
                  <TableCell align="center">Ações</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {documents.map((doc) => (
                  <TableRow key={doc.id}>
                    <TableCell>{doc.title}</TableCell>
                    <TableCell>
                      <Chip label={doc.document_level} color="primary" size="small" />
                    </TableCell>
                    <TableCell>{doc.uploaded_at}</TableCell>
                    <TableCell align="center">
                      <IconButton color="primary" onClick={() => handleDownload(doc.id, doc.filename)}>
                        <Download />
                      </IconButton>
                      <IconButton color="error" onClick={() => handleDelete(doc.id)}>
                        <Delete />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
                {documents.length === 0 && (
                  <TableRow>
                    <TableCell colSpan={4} align="center">Nenhum documento disponível</TableCell>
                  </TableRow>
                )}
              </TableBody>
            </Table>
          </TableContainer>
        )}
      </CardContent>
    </Card>
  );
};

export default DocumentsManagement;
